class DatabaseSeeder extends Seeder
{
    /**
     * Seed the application"s database.
     *
     * @return void
     */
    public function run()
    {
        if (DB::table('location_countries')->count() < 1){
            $this->call(LocationCountry::class);
            $this->call(LocationRegion::class);
            $this->call(LocationCity::class);
            $this->command->info('Населенные пункты загружены успешно!');
        }
        else $this->command->info('Населенные пункты загружены РАНЕЕ!');

        if (DB::table('travel_categories')->count() < 1){
            $this->call(TravelCategories::class);
            $this->call(TravelTypes::class);
            $this->command->info('Категории загружены успешно!');
        }
        else $this->command->info('Категории загружены РАНЕЕ!');

        if (DB::table('status')->count() < 1){
            $this->call(Status::class);
            $this->command->info('Статусы загружены успешно!');
        }
        else $this->command->info('Статусы загружены РАНЕЕ!');

 /*       if (DB::table('images')->count() < 1){
            $this->call(AvatarDefault::class);
            $this->command->info('Загружен дефолтный аватар!');
        }
        else $this->command->info('В таблице есть данные, дефолтный аватар НЕ загружен');*/


    }
}

